import moment from "moment";
import "react-dates/initialize";
import { DateRangePicker } from "react-dates";
import "react-dates/lib/css/_datepicker.css";
import { CCard, CCardHeader, CCardBody, CBadge } from "@coreui/react";

const DatePicker = () => {
  const [date, setDate] = React.useState({ startDate: null, endDate: null });
  const [focused, setFocused] = React.useState();
  const [num, setNum] = React.useState({
    deviceType: "WELL",
    measurementType: "NORMAL",
    searchDateEnd: {
      day: "",
      month: "",
      year: "",
    },
    searchDateStart: {
      day: "",
      month: "",
      year: "",
    },
  });
  const aa = moment(date.startDate).format("YYYY/M/DD");

  const submitFunction = (startDate, endDate) => {
    const startArr = startDate.split("/");
    const endArr = endDate.split("/");

    const requestBody = {
      searchDateEnd: {
        day: endArr[2],
        month: endArr[1],
        year: endArr[0],
      },
      searchDateStart: {
        day: startArr[2],
        month: startArr[1],
        year: startArr[0],
      },
    };
  };

  function submitFilter({ startDate, endDate }) {
    setDate({ startDate, endDate });

    submitFunction(startDate, endDate);
  }

  React.useEffect(() => {
